export default function HobbyIntroduction () {
    return (
        <div>
            <h2>3 Fun Facts About this Hobby:
                <ol>
                    <li>It's free</li>
                    <li>You can geocache alone or with others</li>
                    <li>You get to explore places you wouldn't normally go</li>
                </ol>
            </h2>
        </div>
    );
}
